import React from 'react';

const Track = (props) => {
    const { track } = props;

    return (
        <div className="col-md-6">
            <div className="card mb-4 shadow-sm">
                <div className ="card-body">
                    <p className="card-text">

                        <strong><i className="fas fa-play-circle"> Track</i></strong>: {track}</p> 
                        <p><i className="fas fa-play-circle">  Artist:</i> <h6>{props.artist}</h6>

                    </p>

                    <img src={props.cover} width='150'></img>
                    <p></p>
                    <p>Album: {props.album}</p>
                    <button>View Lyrics</button>
                </div>
            </div>

        </div>
    )
}
export default Track;
